// (c) Kallol Borah, 2020
// Implements sub accounts linked to a specific general ledger accounts

pragma solidity 0.5.7;

import "../interfaces/VerifiedSystem.sol";
import "../interfaces/VerifiedAccount.sol";
import "abdk-libraries-solidity/ABDKMathQuad.sol";
import "@openzeppelin/upgrades/contracts/Initializable.sol";


contract Account is VerifiedAccount, Initializable{

    using ABDKMathQuad for uint256;
    using ABDKMathQuad for int256;
    using ABDKMathQuad for bytes16;

    VerifiedSystem private factory;

    bytes32 public accountName;

    address accountHolder;

    address ledger;

    // data structure for holding transactions
    struct account{
        address counterParty;
        uint256 accountNumber;
        bytes16 txAmount;
        bytes32 txType;
        bytes32 txDate;
        bytes32 txDescription;
        bytes32 voucherType;
    }

    // mapping each account holder to multiple accounts
    mapping(address => account[]) transactions;

    // initiliaze proxies
    function initialize(bytes32 _accountName, address _ledger, address _owner, address _accountHolder) public {
        factory = VerifiedSystem(_owner);
        accountName = _accountName;
        ledger = _ledger;
        accountHolder = _accountHolder;
    }

    // create accounting entry for a transaction
    function postEntry(address _counterParty, uint256 _accountNumber, int256 _txAmount, bytes32 _txType, bytes32 _txDate, bytes32 _txDescription, bytes32 _vchType) external {
        //only account holders can post entries
        require(accountHolder==msg.sender);
        // amount should not be zero
        require(_txAmount !=0);
        // transaction type should be credit or debit
        require(_txType =="Credit" || _txType == "Debit");
        // check if counter party exists
        if(factory.confirmAccountHolder(_counterParty)){
            bool found = false;
            uint256 i =0;
            for(i=0; i<transactions[msg.sender].length; i++){
                if(transactions[msg.sender][i].accountNumber==_accountNumber){
                    found = true;
                    transactions[msg.sender][i].counterParty = _counterParty;
                    transactions[msg.sender][i].txAmount = ABDKMathQuad.fromInt(_txAmount);
                    transactions[msg.sender][i].txType = _txType;
                    transactions[msg.sender][i].txDate = _txDate;
                    transactions[msg.sender][i].txDescription = _txDescription;
                    transactions[msg.sender][i].voucherType = _vchType;
                }
            }
            if(!found){
                transactions[msg.sender][i].accountNumber = _accountNumber;
                transactions[msg.sender][i].counterParty = _counterParty;
                transactions[msg.sender][i].txAmount = ABDKMathQuad.fromInt(_txAmount);
                transactions[msg.sender][i].txType = _txType;
                transactions[msg.sender][i].txDate = _txDate;
                transactions[msg.sender][i].txDescription = _txDescription;
                transactions[msg.sender][i].voucherType = _vchType;
            }
        }
    }

    // get transaction entry for a given account number and date
    function getEntry(uint256 _accountNumber, bytes32 _txDate) external view returns(address, bytes16, bytes32, bytes32, bytes32){
        //only account holders can get entries
        require(accountHolder==msg.sender);
        // transaction date should be specified
        require(_txDate != "");
        address _counterParty;
        bytes32 _txType;
        bytes32 _txDescription;
        bytes16 _txAmount;
        bytes32 _voucherType;
        for(uint256 i=0; i<transactions[msg.sender].length; i++){
            if(transactions[msg.sender][i].accountNumber==_accountNumber && transactions[msg.sender][i].txDate==_txDate){
                _counterParty = transactions[msg.sender][i].counterParty;
                _txAmount = transactions[msg.sender][i].txAmount;
                _txType = transactions[msg.sender][i].txType;
                _txDescription = transactions[msg.sender][i].txDescription;
                _voucherType = transactions[msg.sender][i].voucherType;
            }
        }
        return(_counterParty, _txAmount, _txType, _txDescription, _voucherType);
    }

    function getBalance(address _accountHolder) external view returns(bytes16){
        //only account holders can get balance
        require(accountHolder==msg.sender);
        bytes16 _txAmount;
        for(uint256 i=0; i<transactions[_accountHolder].length; i++){
            _txAmount = ABDKMathQuad.add(_txAmount, transactions[_accountHolder][i].txAmount);
        }
        return _txAmount;
    }

}
